-- Minimum participation ckeck on : T8fc3523d00
CREATE OR REPLACE FUNCTION "ENVO"."T8fc3523d00_checkParticipationMin"("_T6eb551ea00_uid" "ENVO"."uid_domain")
  RETURNS BOOLEAN AS
$$
BEGIN
  IF
  (
    (
      SELECT COUNT(*)
      FROM "ENVO"."T8fc3523d00"
      WHERE "T6eb551ea00_uid" = "_T6eb551ea00_uid"
    ) >= 1
  )
  THEN
    RETURN TRUE;
  ELSE
    RAISE NOTICE 'Participation  %  does not respect minimum value %', 'T8fc3523d00', 1;
    RETURN FALSE;
  END IF;
END;
$$
LANGUAGE 'plpgsql';

